import React from "react";
import ReactDOM from 'react-dom';
import { useState, useEffect } from 'react';
import './App.css';
import {Link, useLocation} from "react-router-dom"
import Emoji from 'a11y-react-emoji'
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Image from 'react-bootstrap/Image'
import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav'
import Dropdown from "react-bootstrap/Dropdown"
import Card from 'react-bootstrap/Card'
import InputGroup from "react-bootstrap/InputGroup"
import Button from "react-bootstrap/Button"
import Form from "react-bootstrap/Form"
import CardGroup from 'react-bootstrap/CardGroup'
import FormControl from "react-bootstrap/FormControl"
import FormGroup from "react-bootstrap/esm/FormGroup";

export function Home({movies, setMovies}) {
    return (
        <div className="App">
            {Navigation()} 
            <Container className="text-center" Style={{ padding:"20px"}}>
            <Row style={{ padding:"25px"}}>
                <h1>Home Page</h1>   
            </Row>
            <Row style={{ padding:"10px"}}>
                <h4>Random Team Generator</h4>
            </Row>    
            <Row>
                <p>Make a team</p> 
            </Row>
            </Container>
        </div>
    );
}

export function ViewTeams({teams, setTeams}) {
    console.log(teams)

    function handleRemove(name, event) {
        console.log(name)
        const remove = async () => {
            const result = await  fetch("/api/removeMovie",{
                method: "POST",
                body: JSON.stringify({name: name}),
                headers:{"Content-Type": "application/json",}
            });
            const body = await result.json();
            console.log(body);
            setTeams(body.teams)
        }
        remove();
        window.location.reload(false);
      }

    return (
        <div className="App">
            {Navigation()}   
            <Container>
                <Row className="text-center" style={{ padding:"25px"}}>
                <h1>View All Teams</h1> 
               </Row>
            </Container>       
            <Row xs={1} md={3} className="g-4">
            { teams.map( (team) => (
                <CardGroup>
                    <Card>
                        {/*<Card.Img variant="top" src={"./images/" + movie.poster}  />*/}
                        <Card.Body>
                        <Card.Title>{team.teamName}</Card.Title>
                        <Card.Text>
                            <p>Players: {team.players}</p>
                            <p>Wins: {team.wins}</p>
                            <p>Losses: {team.losses}</p>
                            <p>Losses: {team.ties}</p>
                        </Card.Text>
                        </Card.Body>
                        <Card.Footer>
                            <Button variant="danger" className="delete" onClick={() => handleRemove(team.name)}>Delete</Button>
                        </Card.Footer>                
                    </Card>
                </CardGroup>
            ))}   
            </Row>        
        </div>
    );
}

export function AddTeam({movies, setMovies}) {

    const handleSubmit = (event) => {
        console.log(document.getElementById("poster"))
        const movieName = document.getElementById("movieName").value
        const releaseDate = document.getElementById("releaseDate").value
        const actors = document.getElementById("actors").value
        const movieRating = document.getElementById("movieRating").value
        const poster = "swep4.jpg"
        {/*event.preventDefault();*/}
        const add = async () => {

            const result = await  fetch('/api/addMovie',{
                method: "POST",
                body: JSON.stringify({name: movieName, date: releaseDate, actors: actors, poster: poster, rating: movieRating}),
                headers:{"Content-Type": "application/json",}
            });
            const body = await result.json();
            console.log(body);
            setMovies(body.movies)
        }
        add();
        console.log(`Movie name, ${movieName}, Relase date ${releaseDate}, actors ${actors}, poster ${poster}, rating ${movieRating}`)  
      }
    return (
        <div className="App">
            {Navigation()} 
            <Container className="text-center">
            <Row style={{ padding:"25px"}}>
                <h1>Add a Star Wars Review</h1>
            </Row>
            <p>Fill out the form below for the movie you wish to review. Then click submit.<br/>You can then see it under See Reviews.</p>
            </Container>
            <Container >
                <Form onSubmit={handleSubmit} >
                    <Row className="mb-3">
                        <FormGroup as={Col}>
                            <Form.Label>Movie Name</Form.Label>
                            <Form.Control type="text" id="movieName" required/>
                        </FormGroup>
                        <FormGroup as={Col}>
                            <Form.Label>Release Date</Form.Label>
                            <Form.Control type="text" id="releaseDate" required/>
                        </FormGroup>
                    </Row>
                    <Row className="mb-3">
                        <FormGroup as={Col} >
                            <Form.Label>Actors</Form.Label>
                            <Form.Control type="text" id="actors" required/>
                        </FormGroup>
                        <Col xs="auto">
                            <Form.Label>Movie Rating</Form.Label>
                            <Form.Select type="text" id="movieRating" required>
                                <option>0</option>
                                <option>1</option>
                                <option>2</option>
                                <option>3</option>
                                <option>4</option>
                                <option>5</option>
                            </Form.Select>
                        </Col>
                    </Row>
                    <Form.Group controlId="formFile" className="mb-3">
                        <Form.Label>Movie Poster</Form.Label>
                        <Form.Control type="file" id="poster" required/>
                    </Form.Group>
                    <Button variant="primary" type="submit" >
                        Submit
                    </Button>
                </Form>
